import { RouterState } from 'mobx-state-router';

export const routes = [
    {
        name: 'login',
        pattern: '/'
    },
    {
        name: 'register',
        pattern: '/register'
    },
    {
        name: 'notFound',
        pattern: '/notFound'
    }
];
